  false,\n\t\"url\": null,\n\t\"notes\": \"This report is a summary of the WHIPPET
  analysis as applied to invasive plant data from San Pablo Bay National Wildlife
  Refuge (refuge). The WHIPPET analysis had two objectives: First, to provide the
  refuge with prioritized invasive plants populations for future management; second,
  to test the WHIPPET online tool for functionality and ease of use. WHIPPET results
  can be used by refuge managers to inform optimal allocation of limited resources
  for invasive plant treatment.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
